import { useEffect, useState } from "react";
import { useTrafficStore } from "../../store/useTrafficStore";
import styles from "../TrafficUpdates/TrafficUpdates.module.css";

type CardProps = {
  title: string;
};

const TrafficUpdates = ({ title }: CardProps) => {
  const { trafficUpdates, fetchTrafficUpdates } = useTrafficStore();

  useEffect(() => {
    fetchTrafficUpdates();
  }, []);

  return (
    <div>
      <h2>{title}</h2>
      {trafficUpdates.length > 0 ? (
        <div className={`${styles.container} bg-green-500 text-white p-4 rounded-2xl`}>
        {trafficUpdates.map((update, index) => (
          <div key={index} className="bg-gray-400 p-4 grid grid-cols-2 gap-4 items-center rounded-xl">
            {/* Vänsterkolumn: Trafikinformation */}
            <div className="bg-teal-500 p-4 rounded-xl">
              <p className="font-bold text-lg">{update.Message}</p>
              <p><strong>Väg:</strong> {update.RoadNumber}</p>
              <p><strong>Allvarlighetsgrad:</strong> {update.SeverityText}</p>
              <p><strong>Tid:</strong> {new Date(update.CreationTime).toLocaleString()}</p>
              <p><strong>Plats:</strong> {update.LocationDescriptor}</p>
            </div>

            {/* Högerkolumn: Bild */}
            <div className="bg-teal-500 p-4 flex justify-center items-center rounded-xl">
              <img 
                src="" // Här kan du lägga en riktig bild
                alt="Traffic Update"
                className="rounded-lg w-full h-auto"
              />
            </div>
          </div>
        ))}
      </div>
      ) : (
        <p>No traffic updates available.</p>
      )}
    </div>
  );
};

export default TrafficUpdates;
